import React from 'react';
import './percent-ring.scss';

export default class PercentRing extends React.Component {
    constructor(props) {
        super(props)

        this.state = {
            percent: props.percent
        }
    }

    render () {
        return <svg
        class="progress-ring"
        width="350"
        height="350">
       <circle
         class="progress-ring__circle"
         stroke="#333333"
         stroke-width="16"
         fill="transparent"
         r="143"
         cx="175"
         cy="175"/>
     </svg>

    }
}
